import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Home from './components/Home';
import CategoryPage from './components/CategoryPage'; // Importing the CategoryPage component
import './App.css';

const App = () => {
    return (
        <Router>
            <div className="App">
                <nav className="category-container">
                    <Link className="category-button" to="/clothes">Clothes</Link>
                    <Link className="category-button" to="/electronics">Electronics</Link>
                    <Link className="category-button" to="/sale">SALE</Link>
                </nav>
                <Routes>
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/home" element={<Home />} />
                    <Route path="/clothes" element={<CategoryPage category="clothes" />} />
                    <Route path="/electronics" element={<CategoryPage category="electronics" />} />
                    <Route path="/sale" element={<CategoryPage category="sale" />} />
                    <Route path="/" element={<h1>Welcome to App</h1>} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
